"Sur une journée, je fais 100 euros juste avec les pieds."
Le business de photos ou vidéos de pieds sur Internet, c'est réel mais ça consiste en quoi ? C'est la question que s'est posé notre journaliste 
@MinaSoundiram. Pour y répondre elle a rencontré Victoria, 24 ans. https://twitter.com/brutofficiel/status/1575172371983499265/video/1

