"On n'a pas la même mémoire mais on a la même histoire."

@OmarSy raconte à @ATrapenard l'importance de faire connaître l'histoire des Sénégalais enrôlés de force pendant la Première Guerre mondiale.

Il est à l'affiche de "Tirailleurs" présenté à #Cannes2022. https://twitter.com/brutofficiel/status/1527329159747612677/video/1

Salam, le film documentaire de @melanie_diams, @HoudaBenyamina et Anne Cissé sortira exceptionnellement en salles les 1er et le 2 juillet prochains.

Sélection officielle et en avant-première mondiale au 
@Festival_Cannes le 26 mai. #Cannes2022 https://twitter.com/brutofficiel/status/1526160250964807680/photo/1

