"Une vie sans livres, ça ressemblerait à quoi ?"
@ATrapenard a invité @madmanclaro, écrivain et traducteur, pour parler de la sensualité du livre et de son obsession pour l’intraduisible.

Plumard, avec Christophe Claro, uniquement sur @BrutXOfficiel : https://bit.ly/38dTYIK https://twitter.com/brutofficiel/status/1517560241516331008/video/1

Dans le sud de la Colombie, certaines zones sont totalement contrôlées par les FARC, un groupe considéré comme terroriste. Notre reporter 
@CamilleCourcy est partie dans les montagnes colombiennes pendant plusieurs semaines pour les rencontrer.

👉  https://youtu.be/9Lu-CtAUAss https://twitter.com/brutofficiel/status/1506339807416528901/video/1

Vivre sans écran pendant un mois, c'est l'expérience menée par un groupe de volontaires pour le docu Privés d’écrans.
@CyrusNorth, lui, a coupé tous ses réseaux pendant 1 mois. Il raconte.

Privés d'écran, un documentaire à voir sur @BrutXofficiel : https://bit.ly/3tnrwws https://twitter.com/brutofficiel/status/1505215016965836803/video/1

"Chacun échafaude des plans dans sa tête : qu’est-ce que je fais si les Russes arrivent ?"

@MareczkoP et sa femme enceinte de 8 mois se sont réfugiés dans une station de métro à Kiev comme de nombreux Ukrainiens.
Pour Brut, il raconte sa première nuit après l'invasion russe. https://twitter.com/brutofficiel/status/1497170089145212930/video/1

